Blockly.Msg.TOUR1_DESCRIPTION06 = "Натисніть тут, щоб повернутись назад до області програмування! ";
Blockly.Msg.TOUR1_DESCRIPTION07 = "Ви можете змінити настройки робота пізніше,<br>якщо ви сконструювали інакшого робота.<br>Якщо ви не маєте робота і хочете потестувати свою програму в симуляції <br>будуть застосовані ці настройки.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "Як тільки ви станете досвідченим користувачем, ви можете перейти в режим \"Експерта\" на панелі інструментів. <br>Тоді ви знайдете більше блоків для програмування свого робота. <br><span class='typcn typcn-media-stop-outline\"></span> pежим початківця <br><span class=\"typcn typcn-star-outline\"></span> режим експерта";
Blockly.Msg.TOUR1_DESCRIPTION08 = "Each program starts with the »program start« block.<br>Further programming blocks, which the robot should execute, should be attached to this block.<br>Just drag'n drop the desired block right under the start block.";  // untranslated
Blockly.Msg.TOUR1_DESCRIPTION09 = "Тут ви знайдете деякі клавіші швидкого виклику!<br>Зліва направо:<br><span class='typcn typcn-media-play\"></span> Натисніть тут щоб запустити програму на реальному роботі<br><span class=\"typcn typcn-cloud-storage\"></span> Збережіть програму, але для того спочатку залогіньтесь<br><span class=\"typcn typcn-zoom\"></span> Натисніть тут і приближте блоки,якщо ви хочете<br><span class=\"typcn typcn-archive\"></span> Відро для сміття! Просто перенесіть блоки до смітника для того щоб видалити їх.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Увага: Ви не зможете відновити блоки після їх видалення!<br>";
Blockly.Msg.TOUR1_DESCRIPTION10 = "Натисніть на \"Дія\"";
Blockly.Msg.TOUR1_DESCRIPTION12 = "Тепер перетягніть новий блок трохи нижче від блоку початку програми. Таким чином, вони будуть з'єднані.";
Blockly.Msg.TOUR1_DESCRIPTION13 = "Тепер відкрийте симулятор...";
Blockly.Msg.TOUR1_DESCRIPTION13a = "і протестуйте свою програму в симуляторі!";
Blockly.Msg.TOUR1_DESCRIPTION15 = "Супер,<br>твій робот їде 20 см вперед,<br>це те, що ви щойно запрограмували!";
